import { useEffect, useState } from "react";


const PostTable = () =>{

    const url = "http://localhost:8080"

    const [postList ,setPostList] = useState(['']);


    useEffect( () =>{
        
        axios.get(`${url}/post`)
        .then((res) => {
            
            setPostList(res.data);
            console.log(postList);

        })
        .error((err) => {
            console.log(err);
        })


    },[])


    return(
        <table>
            <thead>
                <th>번호</th>
                <th>제목</th>
                <th>작성자</th>
            </thead>

        </table>
    )
}

export default PostTable;
